        })
        const data = await res.json();
        console.log(data);

    }

    return (
        <div>
            <Router>
                <Switch>
                    <Route exact path="/matches" component={Matchlist}/>
                    <Route exact path="/match" component={Match}/>
                </Switch>
            </Router>
        </div>
    )
}
export default App;
